import React from 'react';
import { Item as SemanticItem } from 'semantic-ui-react';
import { Circle, CircleMarker, Map as Mapp, Polygon, Popup, TileLayer } from 'react-leaflet';

import Coordinate from '../models/Coordinate';
import Head from 'next/head';

type MapProps = {
  initialLocation: Coordinate;
  polygon: Array<Coordinate>;
};

const center = [51.505, -0.09];

const polygon = [
  [51.515, -0.09],
  [51.52, -0.1],
  [51.52, -0.12],
];

const multiPolygon = [
  [
    [51.51, -0.12],
    [51.51, -0.13],
    [51.53, -0.13],
  ],
  [
    [51.51, -0.05],
    [51.51, -0.07],
    [51.53, -0.07],
  ],
];

const Map = ({ initialLocation }: MapProps): JSX.Element => {
  return (
    <Mapp center={center} zoom={13}>
      <TileLayer
        attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      <Circle center={center} fillColor="blue" radius={200} />
      <CircleMarker center={[51.51, -0.12]} color="red" radius={20}>
        <Popup>Popup in CircleMarker</Popup>
      </CircleMarker>
      <Polygon color="purple" positions={polygon} />
      <Polygon color="purple" positions={multiPolygon} />
    </Mapp>
  );
};

export default Map;
